function SearchBar({ onSearch }) {
  return (
    <input
      type="text"
      placeholder="Search by subject..."
      className="border px-3 py-2 rounded w-full mb-4"
      onChange={(e) => onSearch(e.target.value)}
    />
  );
}

export default SearchBar;
